import React from 'react'
import { ButtonAddOrEditStyle } from '../styledComponents/Buttons.style.js';

const Button = (props) => {
    //className={classes.title}
    return (
        <ButtonAddOrEditStyle>
            <button style={{ color: "red" }} onClick={props.HandlePress}>{props.butttoTitle}</button>
        </ButtonAddOrEditStyle>
    )
}

export default Button
